import "./NavBar.css";
function NavBar() {
  return (
    <div className="navBarCover">
      <div className="navBarItemCover">
        <h1 className="logo">LOGO</h1>
        <div className="labelContainer">
          <ul>
            <li className="item">Home</li>
            <li className="item">Rooms</li>
            <li className="item">Facilities</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default NavBar;
